import React, { Component } from 'react';
import '../../App.css';
import '../../pages/ListNamesPage.css'

class AlphabeticDisplay extends Component {

  handleAllNamesDisplay = () => {
    this.props.resetNamesAlphabetical();
    let sortedNames = [];
    this.props.names.map(name => {
      console.log(name)
        name.baby_name = name.baby_name.toUpperCase();
        sortedNames.push(name)
    })
    sortedNames.sort((a, b) => {
      let A = a.baby_name;
      let B = b.baby_name;
      return (A < B) ? -1: (A > B) ? 1: 0;
    });
    return sortedNames.map((name, index) => {
      return (
        <div key={index} className='baby-name'>
          {name.baby_name.toLowerCase()}
        </div>
      )
    })
  }

  render() {
    return (
      <div>
        {this.handleAllNamesDisplay()}
      </div>
    )
  }
}

export default AlphabeticDisplay;
